import SizeLargeColorWarningSta from "./SizeLargeColorWarningSta";
import "./Home.css";
const Home = () => {
  return (
    <div className="home">
      <img className="image-1-icon" alt="" src="/image-1@2x.png" />
      <div className="button-parent">
        <SizeLargeColorWarningSta
          dimensionLabel="/masked-icon8.png"
          label="Activities"
          productCode="/masked-icon9.png"
          startIcon={false}
          endIcon={false}
          sizeLargeColorWarningStaPosition="absolute"
          sizeLargeColorWarningStaTop="16px"
          sizeLargeColorWarningStaLeft="34px"
          sizeLargeColorWarningStaWidth="321px"
          sizeLargeColorWarningStaHeight="58px"
        />
        <SizeLargeColorWarningSta
          dimensionLabel="/masked-icon8.png"
          label="Hotel Information"
          productCode="/masked-icon9.png"
          startIcon={false}
          endIcon={false}
          sizeLargeColorWarningStaPosition="absolute"
          sizeLargeColorWarningStaTop="90px"
          sizeLargeColorWarningStaLeft="34px"
          sizeLargeColorWarningStaWidth="321px"
          sizeLargeColorWarningStaHeight="58px"
        />
      </div>
      <div className="welcome-to-prague-parent">
        <div className="welcome-to-prague">Welcome to Prague!</div>
        <div className="explore-our-hotels">
          Explore our Hotels and Activities
        </div>
      </div>
    </div>
  );
};

export default Home;
